import { useState, useEffect } from "react";
import api from "../utils/api.js";
import { Link } from "react-router-dom";

function Profile() {
  const [user, setUser] = useState(null);
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const res = await api.get("/users/profile", {
          headers: { Authorization: `Bearer ${token} ` }
        });
        setUser(res.data);
      } catch (error) {
        console.error("Error fetching profile", error);
      }
    };
    fetchProfile();
  }, [token]);

  if (!user) return <p>Loading profile...</p>;

  return (
    <>
      <div className='container mt-5 mb-5'>
        <div className='row'>
          <div className='col-3'></div>
          <div className='col-6 login-backgoround p-5' >
            <h2 className="text-center"><i class="fa-solid fa-user"></i>Profile Details</h2><hr />
            <p className="fs-5"><b>Name:</b> {user.name}</p>
            <p className="fs-5"><b>Age:</b> {user.age || "Not set"}</p>
            <p className="fs-5"><b>Height:</b> {user.height ? `${user.height} cm` : "Not set"}</p>
            <p className="fs-5"><b>Weight:</b> {user.weight ? `${user.weight} kg` : "Not set"}</p>
            <p className="fs-5"><b>Gender:</b> {user.gender || "Not set"}</p>
             {/* Goals section */}
            <p className="fs-5"><b><i class="fa-solid fa-bullseye"></i> Goals:</b></p>
            {user.goal ? (
              <ul>
                <li><i class="fa-solid fa-droplet" style={{color: "#446fe6ff"}}></i> Water: {user.goal.water} glasses</li>
                <li><i class="fa-solid fa-shoe-prints" style={{color: "#046f51ff"}}></i> Steps: {user.goal.steps} steps</li>
                <li><i class="fa-solid fa-bed" style={{color: "#8b5cf6"}}></i> Sleep: {user.goal.sleep} hrs</li>
                <li><i class="fa-solid fa-fire" style={{color: "#f5a029ff" }}></i> Calories: {user.goal.calories} kcal</li>
              </ul>
            ) : (
              <p className="fs-6 text-muted">Not set</p>
            )}
            <div class="d-grid mt-4">
              <button type='submit' className='btn btn-success p-2 fs-4'><Link to={"/profileform"} style={{ color: "#fff" }}>Update Profile</Link></button>
              <button className="btn btn-danger mt-3 fs-4">
                <Link to={"/logout"} style={{ color: "#fff" }}>
                  Logout
                </Link>
              </button>
            </div>
          </div>
          <div className='col-3'></div>
        </div>
      </div>
    </>
  );
}

export default Profile;
